import { Container, Button } from 'reactstrap';


import HomePageCarousel from '../components/HomePage/HomePageCarousel';
import logo from '../assets/logo/cheese-logo.png';

function Home() {
    return(
        <Container>
            <div className='row'>
                <div className='col-12 text-center'>
            <h1 className='text-center'>PZ Cheeseria</h1>
            <img src={logo} alt='logo' className='rounded' width='100' height='100' />
            </div>
            </div>
            <h4 className='text-center'>Delicious, hand-crafted cheeses delivered to your door.</h4>
            <div>
                <HomePageCarousel />                
            </div>
        </Container>
    );
}

export default Home;
